import './App.css';
import { AuthContextProvider } from './Context/AuthContext';
import {Navbar, Header, Program, Nav, Auth} from './index';

function App() {
  return (
    <AuthContextProvider>
      <section>
        <Nav/>
        <Auth/>
      </section>
    </AuthContextProvider>
  );
}

export default App;
